(125, 1, '博鳌论坛', '', '', '', '江西师范大学学生| 博鳌| 论坛|飞机', '张淘汰', '11', '0', ''),
(123, 1, '昆明火车站暴恐', '&lt;p&gt;&lt;strong&gt;&amp;nbsp; &amp;nbsp; 一、批评政府将上访者视为主要维稳对象 忽视恐怖活动&lt;/strong&gt;&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; “新浪微博”用户“冬竹-居士”3月3日发布消息称，“抽刀砍人都有人成功逃脱，上访却没人能成功。你们的维稳对象究竟是谁？”“新浪微博”用户“飛天禪心”3月3日发布消息称，“如果是十几个上访者在火车站，警察出现的数量和速度会如何？”“新浪微博”用户“古成军”（新浪认证：际恒集团客户总监）称，“独家盘点：昆明暴恐案中值得记住的人 （分享自 @新浪新闻）暴力行为人神共愤啊！中国的武装力量一定不能手软啊！由此想起有关部门想尽心思暴力拦截上访人员，城管暴打小贩，为什么不想想办法消除恐怖分子呢？ http://t.cn/8FdT6cU”“新浪微博”用户“宏观市场评论”3月2日称，“中国似乎还没有成系统从中央到地方的专门反恐部门，该把维稳生怕老百姓闹事上访的那些人力物力拿出来干点这些正事了，弄了那么多人和技术力量删帖删微博，有没有做到在网络上严密监控恐怖分子？”“新浪微博”用户“落叶为蔻”3月2日发布消息称，“每次安检那些大爷姑娘们 在我身上一顿乱摸 高峰期拦在路上查身份证；为了安全我们都能忍 忍完了 钱也花了 安全了么，拜托认真点 专业点 精准点 这种有组织专业的恐怖份子 怎么可能一点痕迹都没有 维稳精力 多花点在反恐 少点控制上访强拆吧”“腾讯微博”用户“一刀劈开”3月2日称，“如果有10来个人去昆明火车站上访，安全情报部门肯定有反应。”&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp; 二、呼吁将维稳资金用于反恐&lt;/strong&gt;&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; “新浪微博”用户“凡尼funny”3月2日发布消息称，“把针对阻止人民上访的维稳基金用于反恐，把对付人民群众的各种手段用于反恐，把各种阻挡人民群众发表意见的手段用于防恐，那么我们的反恐效果可能会更好! ”“新浪微博”用户“curl的角落”3月2日发布消息称，“和美国反恐一样，国家应该出台更严厉的措施了。把维稳用在阻拦上访上的经费用到反恐上去吧。”&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp; 三、质疑政府相关部门在防范恐怖活动工作中失职&lt;/strong&gt;&lt;br /&gt;\r\n“新浪微博”用户“廖睿”（新浪认证：四川兴睿峰律师事务所主任）3月2日发布消息称，“暴恐分子严密的组织化运作，安全、情报、反恐部门怎么一点预警都没有发出？是否失职？”“新浪微博”用户“恐空孔”3月2日发布消息称，“如此重大的事件，反恐部门事前到那里去了？从金水桥到昆明火车站，这段时间反恐部门在干什么？每年那么多的维稳费，除了可以对上访者定点打击，反恐部门你们还可以干什么人事？”“腾讯微博”用户“闫欣”3月2日称，“这次恐怖袭击这么成功，我怕这些恐怖分子已经准备下个袭击目标了，培养数十个精通隐匿和屠杀的死士很不容易，国家反恐安全部门在干什么？只会维稳对付上访人员吗？”&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp; 四、呼吁不要将上访活动当成恐怖事件处理&lt;/strong&gt;&lt;br /&gt;\r\n“腾讯微博”用户“花心小老鼠”3月3日称，“昆明的恐怖袭击对国家做出了警示，而做出的反应速度跟力度都会极大的加强。加强反恐力度，不要使它变为双刃剑。希望在内地政府不要把老百姓上访聚集，偶尔当成恐怖事件预警处理。 ”&lt;br /&gt;\r\n&lt;strong&gt;&amp;nbsp; &amp;nbsp; 五、呼吁向公众普及反恐常识&lt;/strong&gt;&lt;br /&gt;\r\n“腾讯微博”用户“Amei”3月2日称，“国内一些二.三线城市的反恐部门被指是养老部门,新设立的维稳大队,也是针对老百姓上访告状的,普及一下实用手册,让老百姓知道遇到紧急状况该如何应对会更实用!”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp;截至3月3日13时，相关微博共转发200余次，评论30余条。约90%的网民认为政府将维稳精力用错了方向，维稳与反恐没有可比性。“新浪微博”用户“龍隱路隱龍”称，“其实情治系统还是蛮有效，只是没用对地方，当年抓许宗衡，有3天前知道信息的，有1天前知道信息的，有抓的当天知道信息的...世上哪有不透风的墙... ”&lt;br /&gt;\r\n“新浪微博”用户“落叶为蔻”称，“从超市实名买菜刀就能看出来 我们维稳不是反恐 ，没见过恐怖分子超市补充装备的吧；市区的反恐一定不是逐个查身份证 不说高科技手段 至少应该有香港海关查走私的敏锐目光从多角度观察人群 观察异样和群体协同行动；首先目的要明确 反恐还是抓上访和逃犯 特征应该不同吧”“新浪微博”用户“YN帅凌云”称，“截访能力全球第一，精准锁定，这是为领导服务，给领导解堵，看看这些年熊猫都干了些什么，忙着请大V喝茶吧。”&lt;br /&gt;\r\n“新浪微博”用户“冉云_飞”称，“以这样的思考，你就真正读懂中国了。 ”“新浪微博”用户“李高峰的微博”称，“维稳的对象是上访人”&lt;br /&gt;\r\n&amp;nbsp; &amp;nbsp; 10%的网民呼吁调查滥用公权力非法拘禁绑架现象。“新浪微博”用户“司马南的葆哥哥”称，“请查处公权参与的非法拘禁绑架，法治不是变着法子治人。”&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n', '', '', '江西师范大学学生 | 安徽黄山民众 | 3月2日 | 抗议恐怖暴行活动 | 飞机 | 论坛', '黎明 | 张淘汰', '22', '北京', '21'),
(127, 1, '1234', '', '', '', '江西师范大学学生', '', '', '', '');
